pragma solidity ^0.8.11;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IBank {
	function totalSupply() external view returns (uint256);

	function balanceOf(address account) external view returns (uint256);

	function allowance(address owner, address spender)
		external
		view
		returns (uint256);

	function _transfer(
		address from,
		address to,
		uint256 amount
	) external;

	function transfer(address _to, uint256 _amount) external returns (bool);

	function approve(address spender, uint256 amount) external returns (bool);

	function transferFrom(
		address sender,
		address recipient,
		uint256 amount
	) external returns (bool);

	event Transfer(address indexed from, address indexed to, uint256 value);
	event Approval(
		address indexed owner,
		address indexed spender,
		uint256 value
	);
}

contract Bank is ERC20, Ownable {
	address public minter;
	uint256 public balances;

	mapping(address => uint256) private individualBalance;

	constructor() ERC20("Luby Coin", "LBC") {
		minter = msg.sender;
	}

	function mint(uint256 amount) public {
		require(
			individualBalance[msg.sender] == 0,
			"Voce ja tem LBC em carteira!"
		);

		uint256 fromBalance = balances;

		_mint(msg.sender, amount);

		individualBalance[msg.sender] += amount;
		balances = fromBalance + amount;
	}

	function transferFrom(
		address from,
		address to,
		uint256 amount
	) public virtual override returns (bool) {
		address spender = minter;
		_spendAllowance(from, spender, amount);
		_transfer(from, to, amount);

		individualBalance[msg.sender] -= amount;
		if (to == minter) {
			balances += amount;
		} else {
			individualBalance[to] += amount;
		}

		return true;
	}

	function transfer(address to, uint256 amount)
		public
		virtual
		override
		returns (bool)
	{
		uint256 fromBalance = balances;
		address owner = minter;
		_transfer(owner, to, amount);

		unchecked {
			balances = fromBalance - amount;
		}

		return true;
	}

	function discountBalanceIndividual(address sender, uint256 amount)
		external
		returns (bool)
	{
		individualBalance[sender] -= amount;
		return true;
	}
}
